namespace DataImportUtility
{
    public class Program
    {
        public static async Task Main(string[] args)
        {
            var host = Host.CreateDefaultBuilder(args)
                .ConfigureServices((hostContext, services) =>
                {
                    services.AddHttpClient();
                    services.AddSingleton<Services.IDataImportService, Services.DataImportService>();
                    services.AddSingleton<Clients.IExternalDataClient, Clients.ExternalDataClient>();
                    services.AddSingleton<Infrastructure.IDataRepository, Infrastructure.DataRepository>();
                    services.AddHostedService<Workers.ImportWorker>();
                })
                .ConfigureLogging(logging =>
                {
                    logging.ClearProviders();
                    logging.AddConsole();
                })
                .Build();

            await host.RunAsync();
